(15, '7enM4V1pXuXikkgCedk2kinBxmdOJyCp', 0, '内马尔大显身手', '运动', 'http://182.92.171.22/vr/showCover/10ba9cde-f38b-44f5-9d63-8d27afc6eaa3.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=5F6AC7528DADC8D5AB2997B73F7DCD8F&auto=1', 'Nike联手内马尔带来360全景视频广告大片，内马尔，相信懂足球的人都知道，来看看这位足球巨星是如何过人得分的吧。', '2016-01-07 16:59:31', '2016-01-07 16:59:31', 1, 1, 14, 78, 1, 2, 2, 2, 2, 0, 1, 1, '23896155', '5F6AC7528DADC8D5AB2997B73F7DCD8F'),
(17, 'tbsKm3evhopb0iNmyEsOrAOnGJB2rwCP', 0, '冰岛之旅', '娱乐, 现场', 'http://182.92.171.22/vr/showCover/53003861-a416-4ac4-a126-68def75715a3.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=F972DA470B1F68B6C81E9F0ABD8EF404&auto=1', '冰岛风景景观的神奇之旅，除了神奇的生物和壮观的火山、瀑布、冰盖，冰岛更让人铭记于心的是大风景隐藏的能量和改变世界陆地形状的巨大力量。', '2016-01-11 10:31:49', '2016-01-11 10:31:49', 0, 1, 0, 16, 0, 0, NULL, NULL, NULL, 0, 1, 1, '23896155', 'F972DA470B1F68B6C81E9F0ABD8EF404'),
(19, 'kDbamfPOdGwSbJnLO4To2XmAZXclg8Ug', 0, '法甲里尔俱乐部实况', '运动', 'http://182.92.171.22/vr/showCover/ec96db45-fe8f-491d-80ac-eb9bbe7b859f.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=7244E25C81091EC9ED25538211917E68&auto=1', '如此精彩的比赛，如此前排的座位，还有什么机会能比这更好的，现场观看法甲比赛吧。', '2016-01-11 10:35:19', '2016-01-11 10:35:19', 0, 1, 0, 10, 0, 0, NULL, NULL, NULL, 0, 1, 1, '23896155', '7244E25C81091EC9ED25538211917E68'),
(20, 'dCKeft2oBQ60ssVh6oFTjkPPc8t7dedj', 0, '飞跃暴风城', '娱乐', 'http://182.92.171.22/vr/showCover/84b9344e-53c3-4649-a7c4-1df1624a1ab9.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=7773F67F24FA39DC1C2A3F2BB37081DB&auto=1', '魔兽电影先睹为快，黑暗势力正向我们袭来，为了生存，开启新的征程！', '2016-01-11 10:40:27', '2016-01-11 10:40:27', 1, 1, 12, 61, 0, 2, NULL, NULL, NULL, 0, 1, 1, '23896155', '7773F67F24FA39DC1C2A3F2BB37081DB'),
(21, 'WRAdE8mLrUOy5ej2S3jMU24tn3uEfxk8', 0, '环太平洋', '科幻', 'http://182.92.171.22/vr/showCover/bdb50377-d042-4c20-973e-b9ed2c96efb4.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=A8872F76A624F34C3BDC9F49E65DB5DE&auto=1', '想体验下控制机器人的感觉，来吧，环太平洋真实模拟现场，你就是超级英雄。', '2016-01-11 10:54:07', '2016-01-11 10:54:07', 0, 1, 0, 51, 0, 1, NULL, NULL, NULL, 0, 1, 1, '23896155', 'A8872F76A624F34C3BDC9F49E65DB5DE'),
(22, 'PTS2GH7oVjYoUaSv3UKJShBASCQjqvBM', 0, '酒保艺术家', '音乐', 'http://182.92.171.22/vr/showCover/0cc685de-930d-4eae-9dc6-8150940ca027.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=22314C45B120849F53D1FC2615E9107B&auto=1', '一个热爱音乐的酒保，学会了多重影分身之术，操刀随手可见的打击乐器，给我们带来了一场视听盛宴。', '2016-01-11 10:56:16', '2016-01-11 10:56:16', 0, 1, 0, 11, 2, 0, NULL, NULL, NULL, 0, 1, 1, '23896155', '22314C45B120849F53D1FC2615E9107B'),
(23, 'l6k5mkbXh1MI3lidpTS0FDAdLQ1h0sly', 0, '科幻全垒打', '运动, 科幻', 'http://182.92.171.22/vr/showCover/36a1405d-4d37-42ea-a392-ec7168692579.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=4F1408579F0703F013C9DB6D96048C72&auto=1', 'MLB大联盟击球员Bryce Harper第一视角领略全垒打魅力；全垒打打出了科幻风，深深的被这项运动的魅力折服，拿起棒球棒，一起打出全垒打吧！', '2016-01-11 10:57:39', '2016-01-11 10:57:39', 0, 1, 13, 29, 2, 1, NULL, NULL, NULL, 0, 1, 1, '23896155', '4F1408579F0703F013C9DB6D96048C72'),
(24, '6gyiH8wNHDNkFSnl0Xnn7EtvliQR3b0x', 0, '明日世界音乐节', '现场, 音乐', 'http://182.92.171.22/vr/showCover/a283ac1f-9b99-46f1-b888-c90c05899a42.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=928B847A8F7606A453D1896CE801ACAF&auto=1', '世界上最大的电子音乐节，去过的人都哭了，场面无比震撼，不得体验。', '2016-01-11 10:59:32', '2016-01-11 10:59:32', 0, 1, 0, 8, 1, 0, NULL, NULL, NULL, 0, 1, 1, '23896155', '928B847A8F7606A453D1896CE801ACAF'),
(25, 'P7skzfvZjVNrGbbDsamxKBQVJfdM4PRL', 0, '谷歌360全景怪兽大片《HELP》', '娱乐, 恐怖', 'http://182.92.171.22/vr/showCover/38504490-2eaf-4067-94b8-71b9961020b6.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=415927702DADE7C903130A9B43FF2871&auto=1', '一起来感受下谷歌360度全景怪兽大片《HELP》，绝对给你不一样的新高度。', '2016-01-11 11:17:55', '2016-01-11 11:17:55', 1, 1, 14, 164, 0, 1, NULL, NULL, NULL, 0, 1, 1, '23896155', '415927702DADE7C903130A9B43FF2871'),
(26, 'pREeLgH6DHt31wtnDwCk1T1tXQos4dqv', 0, '南非欢迎你', '风景', 'http://182.92.171.22/vr/showCover/fe84c5bf-aad9-46ec-8af4-610067b9361b.jpg', 'http://vod.baofengcloud.com/23896155/player/cloud.swf?servicetype=1&uid=23896155&fid=4B57CA81457E53CB7B28098B01E133A9&auto=1', '全方位带你游览南非风景人文景观，海底风光，海滩，企鹅，大象，悬崖，这是一片富饶的土地。', '2016-01-11 11:19:25', '2016-01-11 11:19:25', 0, 1, 15, 90, 0, 4, NULL, NULL, NULL, 0, 1, 1, '23896155', '4B57CA81457E53CB7B28098B01E133A9'),
